import React from "react";

import "../assets/style/components/App.scss";

import { Layout } from 'antd';

const { Header, Footer, Sider, Content } = Layout;


const App = () => (
  <div className="App">

    <Layout>
      <Header>Header</Header>
      <Layout>
        <Sider>Sider</Sider>
        <Content>Content</Content>
      </Layout>
      <Footer>Footer</Footer>
    </Layout>

  </div>
);
export default App;
